{"question":"Organizational functions, according to Fayol, conform to one of the six functional areas. Which one of the following is not an area of organizational functions for strategic planning?","explanation":"Answer <seq no="d" /> is correct.

Fayol did not include human resource management as one of the six functional areas of an organization. The six areas are: technical activities, sales and marketing, financial activities, security activities, accounting activities, and managerial activities.

Answers <seq no="a" />, <seq no="b" />, and <seq no="c" /> are incorrect. Technical activities, financial activities, and sales and marketing are components of the six functional areas.","answers":[{"is_correct":"0","answer":"Technical activities","id":"01"},{"is_correct":"0","answer":"Financial activities","id":"02"},{"is_correct":"0","answer":"Sales and marketing","id":"03"},{"is_correct":"1","answer":"Human resource management","id":"04"}],"correct_ans_str":"D","total_answers":4,"correct_answers":1}

{"question":"Your organization is implementing the balanced scorecard approach to measuring organizational success. In this balanced scorecard method there are four perspectives you'll consider. Which one of the following are the correct four perspectives of the balanced score method?","explanation":"Answer <seq no="c" /> is correct.

The balance scorecard uses four perspectives as follows: Learning and growth, Business process, Customer, and Financial.

Answers <seq no="a" />, <seq no="b" />, and <seq no="d" /> are incorrect. These are not the correct definitions of the balanced score method.","answers":[{"is_correct":"0","answer":"Education, Organizational, Development, and Financial","id":"01"},{"is_correct":"0","answer":"Developmental, Goals, Satisfaction, and Capital","id":"02"},{"is_correct":"1","answer":"Learning and growth, Business process, Customer, and Financial","id":"03"},{"is_correct":"0","answer":"Learning and growth, Management, Customer, and Security","id":"04"}],"correct_ans_str":"C","total_answers":4,"correct_answers":1}
